    /**
     * Test for issue 226.
     */
    public void testEnumSubclass_1999() {
        junit.framework.Assert.assertFalse(com.google.gson.functional.EnumTest_testEnumSubclass_2000.Roshambo.class == com.google.gson.functional.EnumTest_testEnumSubclass_2000.Roshambo.ROCK.getClass());
        junit.framework.Assert.assertEquals("\"ROCK\"", gson.toJson(com.google.gson.functional.EnumTest_testEnumSubclass_2000.Roshambo.ROCK));
        junit.framework.Assert.assertEquals("[\"ROCK\",\"PAPER\",\"SCISSORS\"]", gson.toJson(java.util.EnumSet.allOf(com.google.gson.functional.EnumTest_testEnumSubclass_2000.Roshambo.class)));
        junit.framework.Assert.assertEquals(com.google.gson.functional.EnumTest_testEnumSubclass_2000.Roshambo.ROCK, gson.fromJson("\"ROCK\"", com.google.gson.functional.EnumTest_testEnumSubclass_2000.Roshambo.class));
        junit.framework.Assert.assertEquals(java.util.EnumSet.allOf(com.google.gson.functional.EnumTest_testEnumSubclass_2000.Roshambo.class), gson.fromJson("[\"ROCK\",\"PAPER\",\"SCISSORS\"]", new com.google.gson.reflect.TypeToken<java.util.Set<com.google.gson.functional.EnumTest_testEnumSubclass_2000.Roshambo>>() {}.getType()));
    }

